import SwiftUI


struct EKGAnalysis: View {
    @State private var ekgImage: UIImage? = nil
    
    let base64string: String = ""
    
    var body: some View {
        VStack(spacing: 30) {
            // Header
            HStack {
                            Image(systemName: "person.crop.circle.fill")
                                .resizable()
                                .frame(width: 40, height: 40)
                                .foregroundColor(.blue)
                Spacer()
                            Text("User: Zoe")
                                .font(.system(size: 24, weight: .bold))
                                .foregroundColor(.blue)
                            
                            Spacer() // Push the content to the left
                        }
                        .padding()
                        //.background(LinearGradient(gradient: Gradient(colors: [Color.blue, Color.cyan]), startPoint: .leading, endPoint: .trailing))
                        .cornerRadius(10)
                        //.shadow(radius: 5)
                        .padding(.leading)

            // Display EKG Image
            if let imageData = Data(base64Encoded: base64string, options: .ignoreUnknownCharacters),
               let image = UIImage(data: imageData) {
                Image(uiImage: image)
                    .resizable()
                    .scaledToFit()
                    .frame(maxHeight: 250)
                    .padding(.horizontal)
            } else {
                Text("Invalid EKG Data")
                    .foregroundColor(.red)
                    .padding()
            }

            // EKG Device Reading Section
            VStack {
                Text("Reading data from EKG device...")
                    .font(.system(size: 20, weight: .medium))
                    .foregroundColor(.gray)
                    .padding(.bottom, 2)
                
                // Example BPM reading, you can replace this with dynamic data
                Text("70 bpm (min: 60, max: 75)")
                    .font(.system(size: 18, weight: .regular))
                    .foregroundColor(.black)
                    .padding(.vertical, 8)
                    .padding(.horizontal, 16)
                    .background(Color.green.opacity(0.2))
                    .cornerRadius(10)
            }
            .padding()
            .frame(maxWidth: .infinity)
            .background(Color.white)
            .cornerRadius(15)
            .shadow(radius: 5)
            .padding(.horizontal)
        }
        .padding()
        .ignoresSafeArea(edges: .bottom)
    }
}
